/*
 *  Constructs a aboutdlg as a child of 'parent', with the
 *  name 'name' and widget flags set to 'f'.
 *
 *  The dialog will by default be modeless, unless you set 'modal' to
 *  TRUE to construct a modal dialog.
 */
aboutdlg::aboutdlg( QWidget* parent, const char* name, bool modal, WFlags fl )
    : QDialog( parent, name, modal, fl ),
      image1( (const char **) img1_about )
{
    QImage img;
    img.loadFromData( img0_about, sizeof( img0_about ), "PNG" );
    image0 = img;
    img.loadFromData( img2_about, sizeof( img2_about ), "PNG" );
    image2 = img;
    if ( !name )
	setName( "aboutdlg" );
    setSizePolicy( QSizePolicy( (QSizePolicy::SizeType)0, (QSizePolicy::SizeType)0, 0, 0, sizePolicy().hasHeightForWidth() ) );
    setMinimumSize( QSize( 480, 400 ) );
    setMaximumSize( QSize( 480, 400 ) );
    setPaletteForegroundColor( QColor( 255, 255, 255 ) );
    setPaletteBackgroundColor( QColor( 0, 0, 0 ) );
    QFont f( font() );
    setFont( f ); 
    setIcon( image0 );
    setModal( FALSE );

    line3 = new QFrame( this, "line3" );
    line3->setGeometry( QRect( 10, 238, 460, 20 ) );
    line3->setFrameShape( QFrame::HLine );
    line3->setFrameShadow( QFrame::Sunken );
    line3->setFrameShape( QFrame::HLine );

    aboutLogo = new QLabel( this, "aboutLogo" );
    aboutLogo->setGeometry( QRect( 30, 70, 180, 162 ) );
    aboutLogo->setPixmap( image1 );
    aboutLogo->setScaledContents( TRUE );

    textEdit1 = new QTextEdit( this, "textEdit1" );
    textEdit1->setGeometry( QRect( 10, 290, 460, 90 ) );
    textEdit1->setPaletteForegroundColor( QColor( 230, 230, 230 ) );
    textEdit1->setPaletteBackgroundColor( QColor( 0, 0, 0 ) );
    QFont textEdit1_font(  textEdit1->font() );
    textEdit1_font.setFamily( "Helvetica" );
    textEdit1->setFont( textEdit1_font ); 
    textEdit1->setWordWrap( QTextEdit::FixedColumnWidth );
    textEdit1->setReadOnly( TRUE );
    textEdit1->setUndoRedoEnabled( FALSE );

    VersionLbl = new QLabel( this, "VersionLbl" );
    VersionLbl->setGeometry( QRect( 220, 80, 220, 30 ) );
    VersionLbl->setPaletteForegroundColor( QColor( 240, 240, 240 ) );
    VersionLbl->setPaletteBackgroundColor( QColor( 0, 0, 0 ) );
    QFont VersionLbl_font(  VersionLbl->font() );
    VersionLbl_font.setFamily( "Helvetica" );
    VersionLbl_font.setPointSize( 14 );
    VersionLbl->setFont( VersionLbl_font ); 

    BuildLbl = new QLabel( this, "BuildLbl" );
    BuildLbl->setGeometry( QRect( 220, 110, 450, 45 ) );
    BuildLbl->setPaletteForegroundColor( QColor( 240, 240, 240 ) );
    BuildLbl->setPaletteBackgroundColor( QColor( 0, 0, 0 ) );
    QFont BuildLbl_font(  BuildLbl->font() );
    BuildLbl_font.setPointSize( 11 );
    BuildLbl->setFont( BuildLbl_font ); 

    urlLbl = new KURLLabel( this, "urlLbl" );
    urlLbl->setGeometry( QRect( 10, 250, 280, 40 ) );
    urlLbl->setPaletteForegroundColor( QColor( 85, 255, 255 ) );
    QFont urlLbl_font(  urlLbl->font() );
    urlLbl_font.setUnderline( TRUE );
    urlLbl->setFont( urlLbl_font ); 
    urlLbl->setFrameShape( KURLLabel::NoFrame );
    urlLbl->setFrameShadow( KURLLabel::Plain );
    urlLbl->setProperty( "glowEnabled", QVariant( FALSE, 0 ) );
    urlLbl->setProperty( "floatEnabled", QVariant( FALSE, 0 ) );

    textLabel5 = new QLabel( this, "textLabel5" );
    textLabel5->setGeometry( QRect( 260, 220, 200, 20 ) );
    textLabel5->setPaletteForegroundColor( QColor( 240, 240, 240 ) );
    textLabel5->setPaletteBackgroundColor( QColor( 0, 0, 0 ) );
    QFont textLabel5_font(  textLabel5->font() );
    textLabel5->setFont( textLabel5_font ); 
    textLabel5->setAlignment( int( QLabel::AlignVCenter | QLabel::AlignRight ) );

    TitleLbl = new QLabel( this, "TitleLbl" );
    TitleLbl->setGeometry( QRect( 20, 10, 440, 50 ) );
    TitleLbl->setPaletteForegroundColor( QColor( 240, 240, 240 ) );
    TitleLbl->setPaletteBackgroundColor( QColor( 0, 0, 0 ) );
    QFont TitleLbl_font(  TitleLbl->font() );
    TitleLbl_font.setPointSize( 16 );
    TitleLbl_font.setBold( TRUE );
    TitleLbl->setFont( TitleLbl_font ); 
    TitleLbl->setAlignment( int( QLabel::WordBreak | QLabel::AlignCenter ) );

    close = new QPushButton( this, "close" );
    close->setGeometry( QRect( 433, 255, 30, 30 ) );
    QFont close_font(  close->font() );
    close_font.setFamily( "IPAUIGothic" );
    close->setFont( close_font ); 
    close->setPixmap( image2 );

    CopyleftLbl = new QLabel( this, "CopyleftLbl" );
    CopyleftLbl->setGeometry( QRect( 220, 150, 450, 51 ) );
    CopyleftLbl->setPaletteForegroundColor( QColor( 240, 240, 240 ) );
    CopyleftLbl->setPaletteBackgroundColor( QColor( 0, 0, 0 ) );
    QFont CopyleftLbl_font(  CopyleftLbl->font() );
    CopyleftLbl_font.setFamily( "Helvetica" );
    CopyleftLbl_font.setPointSize( 9 );
    CopyleftLbl->setFont( CopyleftLbl_font ); 
    languageChange();
    resize( QSize(480, 400).expandedTo(minimumSizeHint()) );
    clearWState( WState_Polished );

    // signals and slots connections
    connect( close, SIGNAL( clicked() ), this, SLOT( closeSlot() ) );
    connect( urlLbl, SIGNAL( leftClickedURL() ), this, SLOT( urlSlot() ) );
}

